import React from "react";

import '../styles/header.css'

const Header = () => {
    return (
        <header className="header">
            <div>
                <img className="logo" alt="1floor" 
                src="imgs/logo_64.ico" />
            </div>
            <h1 className="logoName"> 1Floor </h1>
        </header>
    );
}

export default Header;
